  name: AsyncChunkedProcessedQueue<TWorkItem, TChunkProcessor, TChunkHandler>
  nameWithType: AsyncChunkedProcessedQueue<TWorkItem, TChunkProcessor, TChunkHandler>
  fullName: SuperOffice.Threading.AsyncChunkedProcessedQueue<TWorkItem, TChunkProcessor, TChunkHandler>
  type: Class
  assemblies:
  - SoCore
  namespace: SuperOffice.Threading
  summary: Base class for queue or FIFO that is processed in chunks.
  remarks: >-
    As items are added to the queue it is either passed to an exsisting 

    QueueaAsyncChunkHandler for processing or it is passed to a new one.  

    The QueueaAsyncChunkHandler processes queued items until the queue is 

    emptied and then dies.  If there are no current QueueaAsyncChunkHandler 

    working on the queue, a new one is created.
  example: []
  syntax:
    content: 'public class AsyncChunkedProcessedQueue<TWorkItem, TChunkProcessor, TChunkHandler> where TChunkProcessor : QueueAsyncChunkProcessor<TWorkItem>, new() where TChunkHandler : QueueAsyncChunkHandler<TWorkItem, TChunkProcessor>, new()'
    typeParameters:
    - id: TWorkItem
      description: The type that is in the queue
    - id: TChunkProcessor
      description: The processor that processes a chunk of the queue.
    - id: TChunkHandler
      description: Handler holding the thread and is using the processor for processing a chunk of the queue.
    content.vb: Public Class AsyncChunkedProcessedQueue(Of TWorkItem, TChunkProcessor As {QueueAsyncChunkProcessor(Of TWorkItem), New}, TChunkHandler As {QueueAsyncChunkHandler(Of TWorkItem, TChunkProcessor), New})
